import React, { useParams, useState, useEffect }  from 'react'

const Movie = ({ match: { params } }) => {


    const [movie, setMovie] = useState({});

    useEffect(() => {
        setMovie({
            id: params.id
        })
    }) 

    return (
        <>
            <h2>Movie id: {movie.id}</h2>   
        </>
    )
}

export default Movie
